function Title(){
    return(
       <div className="title">
            <h1>BMX Rampage 2021 Highlights</h1>
            <div className="title__sub">
                <h3 className="title__sub--title">By Red Crow</h3>
                <p className="title__sub--date">07/11/2021</p>
                <img className="title__sub--icon1" src="../assets/Icons/views.svg" alt="viewsicon"></img>
                <img className="title__sub--icon2" src="../assets/Icons/likes.svg" alt="likesicon"></img>
            </div>
       </div>
    );
}
export default Title;
